import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import 'w3-css';
import { FetchWithoutId, isAdmin, isLogin } from "./func";
import _ from "lodash";

function Bar() {
    const [categoryData, setCategorydata] = useState();

    useEffect(() => {
        if(_.isEmpty(categoryData)){
            FetchWithoutId(categoryData, setCategorydata, "category");
        }
    },[categoryData]);
    
    function myFunction() {
        var x = document.getElementById("demo");
        if (x.className.indexOf("w3-show") == -1) {
            x.className += " w3-show";
        } else { 
            x.className = x.className.replace(" w3-show", "");
        }
    }

    if(categoryData)
    return ( 
        <>
        <div className="w3-top">
            <ul class="w3-navbar w3-large w3-left-align" style={{backgroundColor:"#cab6ff"}}>
                <li class="w3-hide-medium w3-hide-large w3-black w3-opennav w3-right">
                    <button onclick={() => myFunction()}>&#9776;</button>
                </li>
                <li><a href="#">Home</a></li>
                <li class="w3-hide-small"><a href="#">board</a></li>
                <li class="w3-dropdown-hover">
                    <a href="#">category</a>
                    <div class="w3-dropdown-content w3-white w3-card-4">
                        {categoryData?.map((category, index) => (
                            <button key={index} className="w3-bar-item w3-button w3-light-gray w3-hover-deep-purple w3-border"
                                    onClick={() => window.location.href=`/board/${category.name}/${category.id}`}> {category.name} </button>
                        ))}
                    </div>
                </li>
                <li class="w3-hide-small"><a href="#">setting</a></li>

                {!isLogin && 
                    <li><button className="w3-bar-item w3-button w3-hover-deep-purple w3-right"
                            onClick={() => window.location.href="/login/signup"}>Register</button></li>}
                {!isLogin && 
                    <li><button className="w3-bar-item w3-button w3-hover-deep-purple w3-right"
                            onClick={() => window.location.href="/login"}>Login</button></li>}
                {isLogin && 
                    <li><button className="w3-bar-item w3-button w3-hover-deep-purple w3-right"
                            onClick={() => window.location.href="/mypage"}>MyPage</button></li>}
                {isLogin && <li><button className="w3-bar-item w3-button w3-hover-red w3-right"
                    id="logout" onClick={() => Logout()}>Logout</button></li>}
            </ul>

            <div id="demo" class="w3-hide w3-hide-large w3-hide-medium">
                <ul class="w3-navbar w3-left-align w3-large w3-black">
                    <li><a href="#">Home</a></li>
                    <li class="w3-hide-small"><a href="#">board</a></li>
                    <li class="w3-dropdown-hover">
                        <a href="#">category</a>
                        <div class="w3-dropdown-content w3-white w3-card-4">
                            {categoryData?.map((category, index) => (
                                <button key={index} className="w3-bar-item w3-button w3-light-gray w3-hover-deep-purple w3-border"
                                        onClick={() => window.location.href=`/board/${category.name}/${category.id}`}> {category.name} </button>
                            ))}
                        </div>
                    </li>
                    <li class="w3-hide-small"><a href="#">setting</a></li>
                </ul>
            </div>
        </div>

        </>
        // <>
        // <div className="bar-top">
        //     <div className="w3-bar w3-large" style={{backgroundColor:"#cab6ff"}}>
        //         <div className="bar-left">
        //             <button className="w3-bar-item w3-button w3-hover-deep-purple" onClick={() => window.location.href="/"}>Home</button>
        //             <button className="w3-bar-item w3-button w3-hover-deep-purple"
        //                     onClick={() => {window.location.href = '/board'}}>Board</button>
                        
        //             <div className="w3-dropdown-hover">
        //                 <button className="w3-button w3-hover-deep-purple" style={{marginLeft: "0"}}>Category</button>
        //                 <div className="w3-dropdown-content w3-bar-block barcontent">
        //                     {categoryData?.map((category, index) => (
        //                         <button key={index} className="w3-bar-item w3-button w3-light-gray w3-hover-deep-purple w3-border"
        //                                 onClick={() => window.location.href=`/board/${category.name}/${category.id}`}> {category.name} </button>
        //                     ))}
        //                 </div>
        //             </div>
        //             {isAdmin() && 
        //                 <button className="w3-bar-item w3-button w3-hover-red" onClick={() => window.location.href="/category"}>Setting</button>}
        //         </div>
                
        //         <div>
        //             {!isLogin && 
        //                 <button className="w3-bar-item w3-button w3-hover-deep-purple w3-right"
        //                         onClick={() => window.location.href="/login/signup"}>Register</button>}
        //             {!isLogin && 
        //                 <button className="w3-bar-item w3-button w3-hover-deep-purple w3-right"
        //                         onClick={() => window.location.href="/login"}>Login</button>}
        //             {isLogin && 
        //                 <button className="w3-bar-item w3-button w3-hover-deep-purple w3-right"
        //                         onClick={() => window.location.href="/mypage"}>MyPage</button>}
        //             {isLogin && <button className="w3-bar-item w3-button w3-hover-red w3-right"
        //                 id="logout" onClick={() => Logout()}>Logout</button>}
        //         </div>
        //     </div>
        // </div>
        // </>
    );
}

export function Logout() {
    axios.post('/logout').catch((e) => {
        console.log(e);
    });
    alert("로그아웃되었습니다. 로그인 페이지로 이동합니다.");
    sessionStorage.clear();
    localStorage.clear();
    window.location.replace('/login');
};

export default Bar;
